// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Escrow {
    IERC20 public _token;

    constructor(address ERC20Address) {
        ERC20_deposit_count = 0;
        _token = IERC20(ERC20Address);
    }

    mapping (address => uint) public balances;

    mapping (bytes32 => uint256) public ERC20_balances;
    uint ERC20_deposit_count;

    event Withdraw(address receiver, uint amount);

    receive() external payable {
        balances[msg.sender] += msg.value;
    }

    fallback() external payable {
        deposit(payable(msg.sender));
    }

    function deposit(address payable _receiver) public payable {
        require(msg.value <= 100e18, "You can not send more than 100 ethers");
        balances[_receiver] += msg.value;
    }

    function depositERC20(bytes32 trx_hash, uint amount) external {
        require(trx_hash[0] != 0, "Transaction hash cannot be empty!");
        require(amount != 0, "Escrow amount cannot be equal to 0!");
        require(ERC20_balances[trx_hash] == 0, "Hash is already in use!");
        require(_token.transferFrom(msg.sender, address(this), amount), "Transfer to escrow failed!");

        ERC20_balances[trx_hash] = amount;
        ERC20_deposit_count++;
    }

    function withdraw() external payable {
        uint amount = balances[msg.sender];
        balances[msg.sender] = 0;
        payable(msg.sender).transfer(amount);
        emit Withdraw(msg.sender, amount);
    }

    function getbalancesByAddr(address _addr) public view returns(uint _amount) {
      return balances[_addr];
    }

    function getERC20Hash(uint amount) public view returns(bytes32 result) {
        return keccak256(abi.encodePacked(msg.sender, ERC20_deposit_count, amount));
    }
}

